import React from "react";
import { Grid, Container } from '@material-ui/core'

function VerticalSpace ({ }) {
    return (
        <Container maxWidth="md">
        <Grid container spacing={2} direction="row">
            <Grid item xs={12}></Grid>
            <Grid item xs={12}></Grid>
        </Grid>
        </Container>
    );
}

export default VerticalSpace;
